import Layout from '../components/MyLayout'
//import Beard from '../static/images/beard.png';
//import London from '../static/images/tech.png';
//import Weather from '../static/images/weather.png';

export default () => (
  <Layout>
    <br/>
    <h2>Projects</h2>
    <h4>Link to my GitHub Repository</h4>
    <h5>https://github.com/BonganiMaila</h5>
    <br/>
    <h4>London Tech Store</h4>
    <img src="/static/images/tech.png/" width="700" height="500" alt="tech"/> <br/>

    <br/>
    <h4>Bearded Gent</h4>
    <img src="/static/images/beard.png/" width="700" height="500" alt="beard"/> <br/>   

    <br/>
    <h4>Bearded Gent</h4>
    <img src="/static/images/weather.png/" width="700" height="500" alt="beard"/>    

  </Layout>
)
